function App() {
  return (
    <div className="App">
      <h1>Joao Amaral</h1>
      <h5>
        Hello World? My name is Joao. I'm a front-end developer based in Porto,
        Portugal. I have experience and enjoy building applications using
        Javascript, React and CSS, together with its libraries tailwind and
        bootstrap.
      </h5>
    </div>
  );
}

export default App;
